import React from "react";
import { ReactComponent as Geography } from '../images/categories/geography.svg'

export default function Input(props) {
    return (
        <>

            <div {...props} className=" items-center py-2 h-40 bg">
                <div>
                    <Geography />
                </div>



                <input type={props.type} id={props.id} placeholder={props.placeholder} className=' font-bold text-xl w-full py-2 px-3 my-4 text-white bg-transparent border-b-2 focus:outline-0 placeholder:text-white ' required /><br />
            </div>
        </>
    )
}
